style.css:
a:link {
background-color: transparent ;
color: #1616DB ;
}

a:visited {
background-color: transparent ;
color: #6699CC ;
}

body,header, *[style*="color"], *[background-color], em, li,span[background-color], input[type="button"], input[type="submit"], input[type="reset"], input[type="file"], button, dd, div, h1, h2, h3, h4, h5, h6, table, tr, td, input, select, *[disabled], cite, code, strong, i, ins, th, font,aside, s, pre {
background-color: #C7EDCC ;
color: #080808 ;
}
